import React from 'react';
import {Redirect, Route} from 'react-router-dom';

export const Protected=({component, ...rest})=>(
    <Route>
        {rest}
        render={(props)=>(
            localStorage.getItem('login') ? (<component {...props} />):
            <Redirect to="/login"/> 
        )}
    </Route>
);
